import React, { useEffect } from 'react';

function Services() {
  useEffect(() => {
    // Fade-in animation for the services section
    const servicesSection = document.querySelector('.services');
    servicesSection.style.opacity = '0';
    setTimeout(() => {
      servicesSection.style.transition = 'opacity 1s ease-in';
      servicesSection.style.opacity = '1';
    }, 100);
  }, []);

  return (
    <section className="services">
      {/* Fixed Header for Services Section */}
      <div className="services-fixed-header">
        <h2 className="animate-slide-up">MY SERVICES</h2>
      </div>

      {/* Service Section 1: Selling */}
      <div className="service-section" style={{ backgroundColor: '#2a4058' }}>
        <div className="service-content">
          <div className="service-text">
            <h3 className="animate-slide-up">GET HELP WITH Selling</h3>
            <p className="animate-slide-up">
              Our combination of skill, experience, and technology ensures that we can sell your home for the highest possible price!
            </p>
            <button className="btn animate-slide-up">Learn More</button>
          </div>
          <div className="service-image">
            <img
              src="/images/service-selling.jpg"
              alt="Selling Service"
              className="animate-fade-in"
            />
          </div>
        </div>
      </div>

      {/* Service Section 2: Buying (Example Addition) */}
      <div className="service-section" style={{ backgroundColor: '#3a5a78' }}>
        <div className="service-content">
          <div className="service-text">
            <h3 className="animate-slide-up">GET HELP WITH Buying</h3>
            <p className="animate-slide-up">
              Expert guidance to find your perfect home with ease and confidence.
            </p>
            <button className="btn animate-slide-up">Learn More</button>
          </div>
          <div className="service-image">
            <img
              src="/images/service-buying.jpg" // Replace with actual image path
              alt="Buying Service"
              className="animate-fade-in"
            />
          </div>
        </div>
      </div>

      {/* Add more service sections as needed */}
    </section>
  );
}

export default Services;
